import React from 'react';
import './App.css';

import Routes from './routes';
import logo from './assets/logo.svg';

function App() {
  return (
    <div className="container">
      <img src={logo} alt="Logo"/>

      <div className="content">
        <Routes />
      </div>

    </div>
  );
}

export default App;
